class Solution661 {
	public int[][] imageSmoother(int[][] img) {
		
		//special cases:
		if (img.length==1 && img[0].length==1) { //1x1 img
			return img;
		} else if (img.length==1){//1xN, single row img
			return singleRowImgSmoother(img);
		} else if (img[0].length==1) {//Nx1, single column img
			return singleColImgSmoother(img);
		}//fi
		int[][] sImg = new int[img.length][img[0].length];
		int maxI = img.length-1;
		int maxJ = img[0].length-1;
		
		//top left corner
		sImg[0][0] = (img[0][0]+img[0][1]+img[1][0]+img[1][1])/4;
		//top right corner
		sImg[0][maxJ] = (img[0][maxJ-1]+img[0][maxJ]+img[1][maxJ-1]+img[1][maxJ])/4;
		//bottom left corner		
		sImg[maxI][0] = (img[maxI-1][0]+img[maxI-1][1]+img[maxI][0]+img[maxI][1])/4;
		//bottom right corner
		sImg[maxI][maxJ] = (img[maxI-1][maxJ-1]+img[maxI-1][maxJ]+img[maxI][maxJ-1]+img[maxI][maxJ])/4;
		//top edge
		//bottom edge
		for (int j=1; j<maxJ; j++) {
			sImg[0][j] = (img[0][j-1]+img[0][j]+img[0][j+1]+img[1][j-1]+img[1][j]+img[1][j+1])/6;
			sImg[maxI][j] = (img[maxI-1][j-1]+img[maxI-1][j]+img[maxI-1][j+1]+img[maxI][j-1]+img[maxI][j]+img[maxI][j+1])/6;
		}//rof


		//left edge		
		//right edge
		for (int i=1; i<maxI; i++) {
			sImg[i][0] = (img[i-1][0]+img[i][0]+img[i+1][0]+img[i-1][1]+img[i][1]+img[i+1][1])/6;
			sImg[i][maxJ] = (img[i-1][maxJ-1]+img[i][maxJ-1]+img[i+1][maxJ-1]+img[i-1][maxJ]+img[i][maxJ]+img[i+1][maxJ])/6;
		}//rof
		
		//central area
		for (int i=1; i<maxI; i++) {
			for (int j=1; j<maxJ; j++) {
				sImg[i][j] = (img[i-1][j-1]+img[i-1][j]+img[i-1][j+1]+
							img[i][j-1]+img[i][j]+img[i][j+1]+
							img[i+1][j-1]+img[i+1][j]+img[i+1][j+1])/9;
			}//rof						
		}//rof
		return sImg;
	}// end method
	
	/**
	 * precondition:
	 * assumes single row image
	 * @param img - int[][] 
	 * @return int[][]
	 */
	private int[][] singleRowImgSmoother(int[][] img){
		int[][] sImg = new int[1][img[0].length];		
		int maxJ = img[0].length-1;
		
		//left corner
		sImg[0][0] = (img[0][0]+img[0][1])/2;
		//right corner
		sImg[0][maxJ] = (img[0][maxJ-1]+img[0][maxJ])/2;
		
		//in between
		for (int j=1; j<maxJ; j++) {
			sImg[0][j] = (img[0][j-1]+img[0][j]+img[0][j+1])/3;			
		}//rof
		return sImg;
	}//end method
	
	/**
	 * precondition:
	 * assumes single column image
	 * @param img - int[][] 
	 * @return int[][]
	 */
	private int[][] singleColImgSmoother(int[][] img){
		int[][] sImg = new int[img.length][1];
		int maxI = img.length-1;
		
		//top corner
		sImg[0][0] = (img[0][0]+img[1][0])/2;
		
		//bottom corner		
		sImg[maxI][0] = (img[maxI-1][0]+img[maxI][0])/2;

		//in between
		for (int i=1; i<maxI; i++) {
			sImg[i][0] = (img[i-1][0]+img[i][0]+img[i+1][0])/3;			
		}//rof
		return sImg;
	}//end method
}// end class
